import React from 'react';
import { connect } from 'react-redux';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import classes from './View.module.css';

const workoutview = props => {
    console.log(props.match.params);
    console.log(props.workouts);
    const workout = props.workouts
    return(
        <Container>
            <Row>
                <h3>{props.workout.name}</h3>
                <span className={classes.Red}>{props.workout.description}</span>
                <div className={classes.Description}>
                    <span>{props.workout.created_at}</span>
                </div>
            </Row>
            <Row>
                <span>{props.workout.description}</span>
            </Row>
        </Container>
     );
};

const mapStateToProps = state => {
    console.log(state);
    return {
        workout: state.workouts.view
    }
}

export default connect(mapStateToProps)( workoutview );
